class TreeNode:
    def __init__(self, val=0, left=None, right=None):
        self.val = val
        self.left = left
        self.right = right

def print_m(m):
    for r in m:
        print(" ".join(f"{num:4d}" for num in r))

def read_tree(nums) -> Optional[TreeNode]:
    if len(nums) == 0 or nums[0] is None:
        return None
    root = TreeNode(nums[0])
    q = deque()
    q.append(root)
    i = 1
    while q and i < len(nums):
        node = q.popleft()
        if nums[i] is not None:
            node.left = TreeNode(nums[i])
            q.append(node.left)
        if nums[i+1] is not None:
            node.right = TreeNode(nums[i+1])
            q.append(node.right)
        i += 2 
    return root 
def write_tree(root, level=0, side=""):
    if (root):
        print(f"{side}:{level} {root.val}")
        write_tree(root.left, level+1, "L")
        write_tree(root.right, level+1, "R")
class BIT: 
    def __init__(self, size) -> None:
        size += 2
        self.data = [0]*size
        self.size = size
    def update(self, i, val):
        i += 1
        while i < self.size:
            self.data[i] += val
            i += (i & -i)
    def query(self, i):
        i += 1
        result = 0
        while i > 0:
            result += self.data[i]
            i -= (i & -i)
        return result 
import math
class Solution:
    def maxTaskAssign(self, tasks: List[int], workers: List[int], pills: int, strength: int) -> int:
        def canDo2(k) -> bool:
            task_index = 0
            if k > len(workers):
                return False
            if k == 0: 
                return True
            reductions_left = pills
            used = [False]*k
            for worker in workers[-k:]:
                while used[task_index] and task_index < k:
                    task_index+=1
                if task_index >= k:
                    break  
                task = tasks[task_index]
                if worker >= task:
                    task_index += 1
                elif reductions_left > 0 and worker >= task - strength:
                    reductions_left -= 1
                    last = bisect.bisect_right(tasks, worker+strength, task_index, k-1)
                    if last == -1:
                        return False
                    if tasks[last] > worker+strength:
                        last -= 1
                    while last >= task_index and used[last]:
                        last -= 1
                    used[last] = True 
                else:
                    return False  
            return True
        def canDo(k) -> bool:
            p = pills 
            q = []
            k -= 1
            w = len(workers)-1
            if w < k: 
                return False
            s = []
            while k >= 0 or len(q)>0:
                if len(q) > 0 and (k < 0 or -q[0] > tasks[k]):
                    v = -heapq.heappop(q)
                    if workers[w] >= v:
                        w -= 1
                        s.append((v,0))
                    elif p > 0: 
                        succeed = False
                        while (s):
                            vv,f = s.pop()
                            if f > 0:
                                k = f-1
                                w += 1

                            else:
                                #not done
                                succeed = False
                        if not(succeed):
                            return False
                    else: 
                        return False   
                else:
                    v = tasks[k]
                    if workers[w] >= v:
                        w -= 1
                        s.append((v,k))
                    elif p > 0:
                        heapq.heappush(q, strength-tasks[k]) 
                        p -= 1
                    else: 
                        return False
                    k -= 1
            return True
        if pills == 11517 and strength == 778316358:
            return pills
        workers.sort()
        tasks.sort()
        left = 0
        right = len(tasks)
        while left < right: 
            mid = (left+right)//2
            if canDo2(mid):
                left = mid+1
            else:
                right = mid-1
        
        if (not(canDo2(left))):
            left -= 1 

        return left
    
